Rules.InvariantScript:
Set(
    calenderItems,
    First(
        ForAll(
            Office365Outlook.CalendarGetTablesV2().value,
            Office365Outlook.V4CalendarGetItems(
                ThisRecord.id,
                {
                    '$orderby': "Start/DateTime",
                    '$filter': Concatenate(
                        "Start/DateTime gt '",
                        Text(
                            Text(
                                Now(),
                                UTC
                            ),
                            "yyyy-mm-ddTHH:mm:ss"
                        ),
                        "'",
                        " and Start/DateTime lt '",
                        Text(
                            Today() + 1,
                            "yyyy-mm-ddTHH:mm:ss"
                        ),
                        "'"
                    )
                }
            )
        ).value
    ).value
)
// format DateTime: "Text(Now(); UTC)" for UTC timezone and "Text(Now(); Start/DateTime gt 'yyyy-mm-ddTHH:mm:ss')" for Timestamp format
